import React, { Component } from 'react'
import BG from '../../img/kristy_george.png';
import GM from '../../img/getting_married.png';
export default class Landing extends Component {
    render() {
        return (
        <body>
            <div className="row">
                <div className="column">
                    <img 
                        src={GM} style={{
                            marginLeft:'auto',
                            height: 'auto',
                            width: '100%'
                        }}
                        alt="kandg">    
                    </img>
                </div>
                <div className="column">
                    <img 
                        src={BG} 
                        className="bg" 
                        style={{
                            boxShadow:" 3px 3px 3px rgba(0,0,0,.5)",
                            height: 'auto',
                            width: 'auto'
                        }}
                        alt="kandg">

                    </img>
                </div>
            </div>
        </body>
        )
    }
}
